description:
Trials Evolution is on every front the next dimension of the smash-hit, award-winning Trials HD. Bust out of the warehouse into an outdoor world of night and day, curving drive lines, and spectacular scenery. Multiplayer comes alive, in your living room or on Xbox LIVE. Build your own tracks with the included editor or download those of any other player from the new Track Central. Trials Evolution is survival of the fastest.
